// MovieCard.js
import React from "react";

function MovieCard({ movie, onClick }) {
    return (
        <div className="movie-card" onClick={onClick}>
            <h3>{movie.title}</h3>
            <p>Rating: {movie.rating}</p>
        </div>
    );
}

export default MovieCard;
